import React from 'react'
import Threed from '../Threed';
import '../../App.css';

function Ramuygulamari1() {
  return (
    <> 
    <h2 className='ram1-margin'>T-RJU Jboks Ünitesi</h2>
    <Threed />
    <p>Bu ünite, ram ve sanfor girişinde kumaş değişimi sırasında makinenin non stop çalışması için kullanılmaktadır. Kumaş cinsine göre girişinde ünitenin girişinde T-COS Çıtalı ortalayıcı veya T-BOS Beşikli ortalayıcı ünite bulunmaktadır. Kumaş gerginliği pnömatik balerin sistemi ile kontol edilmektedir. Kumaş girişi kauçuk kaplamalı silindir ile kumaşı daha iyi tutmaktadır.
      Kumaşın üniteden by-pass geçmesi için gerekli avare sistemler ile donatılmıştır. Kumaş seviye kontrol sistemi ile donatılmıştır.</p>


    </>
  )
}

export default Ramuygulamari1;
